interactions:
- request:
    body: "--BOUNDARY\r\nContent-Disposition: form-data; name=\"purpose\"\r\n\r\ntune\r\n--BOUNDARY\r\nContent-Disposition:
      form-data; name=\"file\"; filename=\"test_tune_train.json\"\r\nContent-Type:
      application/json\r\n\r\n[\n  {\n    \"input\": \"Paper Title: Auto-Panoptic:
      Cooperative Multi-Component Architecture Search for Panoptic Segmentation; Impact
      statement: This work makes the first attempt to search for all key components
      of panoptic pipeline and manages to accomplish this via the proposed Cooperative
      Multi-Component Architecture Search and efficient Path-Priority Search Policy.
      Most related work in the literature of NAS for fine-grained vision tasks concentrates
      on searching a specific part of the network and the balance of the overall network
      is largely ignored. Nevertheless, this type of technology is essential to improve
      the upper bound of popular detectors and segmentation networks. This may inspire
      new work towards the efficient search of the overall architecture for fine-grained
      vision tasks, e.g., object detection, semantic segmentation, panoptic segmentation
      and so on. We are not aware of any imminent risks of placing anyone at a disadvantage.
      In the future, more constraints and optimization algorithms can be applied to
      strike the optimal trade-off between accuracy and latency to deliver customized
      architecture for different platforms and devices.\",\n    \"output\": \"doesn't
      mention a harmful application\"\n  },\n  {\n    \"input\": \"Paper Title: Design
      Space for Graph Neural Networks; Impact statement: Impact on GNN research .
      Our work brings in many valuable mindsets to the field of GNN research. For
      example, we fully adopt the principle of controlling model complexity when comparing
      different models, which is not yet adopted in most GNN papers. We focus on finding
      guidelines / principles when designing GNNs, rather than particular GNN instantiations.
      We emphasize that the best GNN designs can drastically differ across tasks (the
      state-of-the-art GNN model on one task may have poor performance on other tasks).
      We thus propose to evaluate models on diverse tasks measured by quantitative
      similarity metric. Rather than criticizing the weakness of existing GNN architectures,
      our goal is to build a framework that can help researchers understand GNN design
      choices when developing new models suitable for different applications. Our
      approach serves as a tool to demonstrate the innovation of a novel GNN model
      ( e.g. , in what kind of design spaces / task spaces, a proposed algorithmic
      advancement is helpful), or a novel GNN task ( e.g. , showing that the task
      is not similar to any existing tasks thus calls for new challenges of algorithmic
      development). Impact on machine learning research . Our approach is in fact
      applicable to general machine learning model design. Specifically, we hope the
      proposed controlled random search technique can assist fair evaluation of novel
      algorithmic advancements. To show whether a certain algorithmic advancement
      is useful, it is important to sample random model-task combinations, then investigate
      in what scenarios the algorithmic advancement indeed improves the performance.
      Additionally, the proposed task similarity metric can be used to understand
      similarities between general machine learning tasks, e.g. , classification of
      MNIST and CIFAR-10. Our ranking-based similarity metric is fully general, as
      long as different designs can be ranked by their performance. Impact on other
      research domains . Our framework provides an easier than ever support for experts
      in other disciplines to solve their problems via GNNs. Domain experts only need
      to provide properly formatted domain-specific datasets, then recommended GNN
      designs will be automatically picked and applied to the dataset. In the fastest
      mode, anchor GNN models will be applied to the novel task in order to measure
      its similarity with known GNN tasks, where the corresponding best GNN designs
      have been saved. Top GNN designs in the tasks with high similarity to the novel
      task will be applied. If computational resources permitted, a full grid search
      / random search over the design space can also be easily carried out to the
      new task. We believe this pipeline can significantly lower the barrier for applying
      GNN models, thus greatly promote the application of GNNs in other research domains.
      Impact on the society . As is discussed above, given its clarity and accessibility,
      we are confident that our general approach can inspire novel applications that
      are of high impact to the society. Additionally, its simplicity can also provide
      great opportunities for AI education, where students can learn from SOTA deep
      learning models and inspiring applications at ease.\",\n    \"output\": \"doesn't
      mention a harmful application\"\n  },\n  {\n    \"input\": \"Paper Title: Learning
      the Geometry of Wave-Based Imaging; Impact statement: We do not see any major
      ethical consequences of this work. Our work has implications in the fields of
      exploratory imaging \\u2014 earthquake detection, medical imaging etc. Our work
      improves the quality and reliability of imaging in these fields. Improving these
      fields has direct societal impact in finding new natural preserves, improved
      diagnosis in healthcare etc. A failure of our system leaves machine learning
      unreliable in exploratory imaging. Our method provides strong out-of-distribution
      generalization and hence is not biased according to the data.\",\n    \"output\":
      \"doesn't mention a harmful application\"\n  },\n  {\n    \"input\": \"Paper
      Title: Noise2Same: Optimizing A Self-Supervised Bound for Image Denoising; Impact
      statement: In this paper, we introduce Noise2Same, a self-supervised framework
      for deep image denoising. As Noise2Same does not need paired clean data, paired
      noisy data, nor the noise model, its application scenarios could be much broader
      than both traditional supervised and existing self-supervised denoising frameworks.
      The most direct application of Noise2Same is to perform denoising on digital
      images captured under poor conditions. Individuals and corporations related
      to photography may benefit from our work. Besides, Noise2Same could be applied
      as a pre-processing step for computer vision tasks such as object detection
      and segmentation [ 18], making the downstream algorithms more robust to noisy
      images. Also, specific research communities could benefit from the development
      of Noise2Same as well. For example, the capture of high-quality microscopy data
      of live cells, tissue, or nanomaterials is expensive in terms of budget and
      time [27]. Proper denoising algorithms allow researchers to obtain high-quality
      data from low-quality data and hence remove the need to capture high-quality
      data directly. In addition to image denoising applications, the self-supervised
      denoising framework could be extended to other domains such as audio noise reduction
      and single-cell [1]. On the negative aspect, as many imaging-based research
      tasks and computer vision applications may be built upon the denoising algorithms,
      the failure of Noise2Same could potentially lead to biases or failures in these
      tasks and applications.\",\n    \"output\": \"mentions a harmful application\"\n
      \ },\n  {\n    \"input\": \"Paper Title: When Counterpoint Meets Chinese Folk
      Melodies; Impact statement: The idea of integrating Western counterpoint into
      Chinese folk music generation is innovative. It would make positive broader
      impacts on three aspects: 1) It would facilitate more opportunities and challenges
      of music cultural exchanges at a much larger scale through automatic generation.
      For example, the inter-cultural style fused music could be used in Children\\u2019s
      enlightenment education to stimulate their interest in both cultures. 2) It
      would further the idea of collaborative counterpoint improvisation between two
      parts ( e . g ., a human and a machine) to music traditions where such interaction
      was less common. 3) The computer-generated music may \\u201creshape the musical
      idiom\\u201d[23], which may bring more opportunities and possibilities to produce
      creative music. The proposed work may also have some potential negative societal
      impacts: 1) Similar to other computational creativity research, the generated
      music has the possibility of plagiarism by copying short snippets from the training
      corpus, even though copyright infringement is not a concern as neither folk
      melodies nor Bach\\u2019s music has copyright. That being said, our online music
      generation approach conditions music generation on past human and machine generation,
      and is less likely to directly copy snippets than offline approaches do. 2)
      The proposed innovative music generation approach may cause disruptions to current
      music professions, even deprive them of their means of existence[23]. However,
      it also opens new areas and creates new needs in this we-media era . Overall,
      we believe that the positive impacts significantly outweigh the negative impacts.\",\n
      \   \"output\": \"mentions a harmful application\"\n  },\n  {\n    \"input\":
      \"Paper Title: Learning from Label Proportions: A Mutual Contamination Framework;
      Impact statement: LLP has been discussed as a model for summarizing a fully
      labeled dataset for public dissemination. The idea is that individual labels
      are not disclosed, so some degree of privacy is retained. As we show, consistent
      classification is still possible in this setting. If the two class-conditional
      distributions are nonoverlapping, labels of training instances can be recovered
      with no uncertainty by an optimal classifier. If the class-conditional distributions
      have some overlap, training instances in the nonoverlapping region can still
      be labeled with no uncertainty, while training instances in the overlapping
      regions can have their labels guessed with some uncertainty, depending on the
      degree of overlap.\",\n    \"output\": \"doesn't mention a harmful application\"\n
      \ },\n  {\n    \"input\": \"Paper Title: Limits to Depth Efficiencies of Self-Attention;
      Impact statement: Our work aims at providing fundamental guidelines which can
      assist all fields that employ Transformer-based architectures to use more efficient
      models. This way, these fields can achieve their goals while consuming less
      resources. Additionally, this work made an effort to provide a theoretical interpretation
      by examining the (many) empirical signals already published by others, while
      providing only a required minimum of further experimentation. This was done
      under the belief that while experiments are crucial for the advancement of the
      field, it is important not to conduct them superfluously as they incur an environmental
      price [Schwartz et al., 2019].\",\n    \"output\": \"doesn't mention a harmful
      application\"\n  },\n  {\n    \"input\": \"Paper Title: Meta-Consolidation for
      Continual Learning; Impact statement: (as required by NeurIPS 2020 CFP) Continual
      learning is a key desiderata for Artificial General Intelligence (AGI). Hence,
      this line of research has the benefits as well as the pitfalls of any other
      research effort geared in this direction. In particular, our work can help deliver
      impact on making smarter AI products and services, which can learn and update
      themselves on-the-fly when newer tasks and domains are encountered, without
      forgetting previously acquired knowledge. This is a necessity in any large-scale
      deployments of machine learning and computer vision, including in social media,
      e-commerce, surveillance, e- governance, etc - each of which have newer settings,
      tasks or domains added continually over time. Any negative effect of our work,
      such as legal and ethical concerns, are not unique to this work - to the best
      of our knowledge, but are shared with any other new development in machine learning,
      in general.\",\n    \"output\": \"mentions a harmful application\"\n  },\n  {\n
      \   \"input\": \"Paper Title: Learning to Incentivize Other Learning Agents;
      Impact statement: Our work is a step toward the goal of ensuring the common
      good in a potential future where independent reinforcement learning agents interact
      with one another and/or with humans in the real world. We have shown that cooperation
      can emerge by introducing an additional learned incentive function that enables
      one agent to affect another agent\\u2019s reward directly. However, as agents
      still independently maximize their own individual rewards, it is open as to
      how to prevent an agent from misusing the incentive function to exploit others.
      One approach for future research to address this concern is to establish new
      connections between our work and the emerging literature on reward tampering
      [11]. By sparking a discussion on this important aspect of multi-agent interaction,
      we believe our work has a positive impact on the long-term research endeavor
      that is necessary for RL agents to be deployed safely in real-world applications.\",\n
      \   \"output\": \"doesn't mention a harmful application\"\n  },\n  {\n    \"input\":
      \"Paper Title: An Improved Analysis of (Variance-Reduced) Policy Gradient and
      Natural Policy Gradient Methods; Impact statement: The results of this paper
      improves the performance of policy-gradient methods for reinforcement learning,
      as well as our understanding to the existing methods. Through reinforcement
      learning, our study will also benefit several research communities such as machine
      learning and robotics. We do not believe that the results in this work will
      cause any ethical issue, or put anyone at a disadvantage in our society.\",\n
      \   \"output\": \"doesn't mention a harmful application\"\n  },\n  {\n    \"input\":
      \"Paper Title: Sample-Efficient Reinforcement Learning of Undercomplete POMDPs;
      Impact statement: As this is a theoretical contribution, we do not envision
      that our direct results will have a tangible societal impact. Our broader line
      of inquiry could impact a line of thinking in a way that provides additional
      means to provide confidence intervals relevant for planning and learning. There
      is an increasing needs for applications to understand planning under uncertainty
      in the broader context of safety and reliability, and POMDPs provide one potential
      framework.\",\n    \"output\": \"doesn't mention a harmful application\"\n  },\n
      \ {\n    \"input\": \"Paper Title: Reward-rational (implicit) choice: A unifying
      formalism for reward learning; Impact statement: As AI capability advances,
      it is becoming increasingly important to align the objectives of AI agents to
      what people want. From how assistive robots can best help their users, to how
      autonomous cars should trade off between safety risk and efficiency, to how
      recommender systems should balance revenue considerations with longer-term user
      happiness and with avoiding influencing user views, agents cannot rely on a
      reward function specified once and set in stone. By putting different sources
      of information about the reward explicitly under the same framework, we hope
      our paper contributes towards a future in which agents maintain uncertainty
      over what their reward should be, and use different types of feedback from humans
      to refine their estimate and become better aligned with what people want over
      time \\u2013 be them designers or end-users. On the flip side, changing reward
      functions also raises its own set of risks and challenges. First, the relationship
      between designer objectives and end-user objectives is not clear. Our framework
      can be used to adapt agents to end-users preferences, but this takes away control
      from the system designers. This might be desirable for, say, home robots, but
      not for safety-critical systems like autonomous cars, where designers might
      need to enforce certain constraints a-priori on the reward adaptation process.
      More broadly, most systems have multiple stake-holders, and what it means to
      do ethical preference aggregation remains an open problem. Further, if the robot\\u2019s
      model of the human is misspecified, adaptation might lead to more harm than
      good, with the robot inferring a worse reward function than what a designer
      could specify by hand.\",\n    \"output\": \"mentions a harmful application\"\n
      \ },\n  {\n    \"input\": \"Paper Title: Flows for simultaneous manifold learning
      and density estimation; Impact statement: Manifold-learning flows have the potential
      to improve the efficiency with which scientists extract knowledge from large-scale
      experiments. Many phenomena have their most accurate description in terms of
      complex computer simulations which do not admit a tractable likelihood. In this
      common case, normalizing flows can be trained on synthetic data and used as
      a surrogate for the likelihood function, enabling high-quality inference on
      model parameters [21]. When the data have a manifold structure, manifold-learning
      flows may improve the quality and efficiency of this process further and ultimately
      contribute to scientific progress. We have demonstrated this with a real-world
      particle physics dataset, though the same technique is applicable to fields
      as diverse as neuroscience, systems biology, and epidemiology. All generative
      models carry a risk of being abused for the generation of fake data that are
      then masqueraded as real documents. This danger also applies to manifold-learning
      flows. While manifold-learning flows are currently far away from being able
      to generate realistic high-resolution images, videos, or audio, this concern
      should be kept in mind in the long term. Finally, the models we trained on image
      datasets of human faces clearly lack diversity. They reproduce and reinforce
      the biases inherent in the training data. Before using such (or other) models
      in any real-life application, it is crucial to understand, measure, and mitigate
      such biases.\",\n    \"output\": \"mentions a harmful application\"\n  },\n
      \ {\n    \"input\": \"Paper Title: Implicit Neural Representations with Periodic
      Activation Functions; Impact statement: The proposed SIREN representation enables
      accurate representations of natural signals, such as images, audio, and video
      in a deep learning framework. This may be an enabler for downstream tasks involving
      such signals, such as classification for images or speech-to-text systems for
      audio. Such applications may be leveraged for both positive and negative ends.
      SIREN may in the future further enable novel approaches to the generation of
      such signals. This has potential for misuse in impersonating actors without
      their consent. For an in-depth discussion of such so-called DeepFakes, we refer
      the reader to a recent review article on neural rendering [16].\",\n    \"output\":
      \"mentions a harmful application\"\n  },\n  {\n    \"input\": \"Paper Title:
      Neural Message Passing for Multi-Relational Ordered and Recursive Hypergraphs;
      Impact statement: Message Passing Neural Networks (MPNNs) are a framework for
      deep learning on graph structured data. Graph structures are universal and very
      generic structures commonly seen in various forms in computer vision, natural
      language processing, recommender systems, traffic prediction, generative models,
      and many more. Graphs can have many variations such as multi-relational, heterogeneous,
      hypergraphs, etc. Our research in this paper unifies several existing MPNN methods
      on these variations. While we show how our research could be used for academic
      networks, and factual knowledge, it opens up many more possibilities in natural
      language processing (NLP). We see opportunities for research applying our work
      for beneficial puroposes, such as investigating whether we could improve performance
      of NLP tasks such as machine reading comprehension, relation extraction, machine
      translation, and many more. Potentially hazardous applications include trying
      to predict criminality or credit from social networks. Such applications may
      reproduce and exacerbate bias and readers of the paper should be aware that
      the presented model should not applied naively to such tasks.\",\n    \"output\":
      \"mentions a harmful application\"\n  },\n  {\n    \"input\": \"Paper Title:
      COT-GAN: Generating Sequential Data via Causal Optimal Transport; Impact statement:
      The COT-GAN algorithm introduced in this paper is suitable to generate sequential
      data, when the real dataset consists of i.i.d. sequences or of stationary time
      series. It opens up doors to many applications that can benefit from time series
      synthesis. For example, researchers often do not have access to abundant training
      data due to privacy concerns, high cost, and data scarcity. This hinders the
      capability of building accurate predictive models. Ongoing research is aimed
      at developing a modified COT-GAN algorithm to generate financial time series.
      The high non-stationarity of financial data requires different features and
      architectures, whilst causality when measuring distances between sequences remains
      the crucial tool. The application to market generation is of main interest for
      the financial and insurance industry, for example in model- independent pricing
      and hedging, portfolio selection, risk management, and stress testing. In broader
      scientific research, our approach can be used to estimate from data the parameters
      of simulation-based models that describe physical processes. These models can
      be, for instance, differential equations describing neural activities, compartmental
      models in epidemiology, and chemical reactions involving multiple reagents.\",\n
      \   \"output\": \"doesn't mention a harmful application\"\n  },\n  {\n    \"input\":
      \"Paper Title: Cream of the Crop: Distilling Prioritized Paths For One-Shot
      Neural Architecture Search; Impact statement: Similar to previous NAS works,
      this work does not have immediate societal impact, since the algorithm is only
      designed for image classification, but it can indirectly impact society. As
      an example, our work may inspire the creation of new algorithms and applications
      with direct societal implications. Moreover, compared with other NAS methods
      that require additional teacher model to guide the training process, our method
      does not need any external teacher models. So our method can be used in a closed
      data system, ensuring the privacy of user data.\",\n    \"output\": \"doesn't
      mention a harmful application\"\n  },\n  {\n    \"input\": \"Paper Title: Deep
      Evidential Regression; Impact statement: Uncertainty estimation for neural networks
      has very significant societal impact. Neural networks are increasingly being
      trained as black-box predictors and being placed in larger decision systems
      where errors in their predictions can pose immediate threat to downstream tasks.
      Systematic methods for calibrated uncertainty estimation under these conditions
      are needed, especially as these systems are deployed in safety critical domains,
      such for autonomous vehicle control [29], medical diagnosis [43], or in settings
      with large dataset imbalances and bias such as crime forecasting [24] and facial
      recognition [3]. This work is complementary to a large portion of machine learning
      research which is continually pushing the boundaries on neural network precision
      and accuracy. Instead of solely optimizing larger models for increased performance,
      our method focuses on how these models can be equipped with the ability to estimate
      their own confidence. Our results demonstrating superior calibration of our
      method over baselines are also critical in ensuring that we can place a certain
      level of trust in these algorithms and in understanding when they say \\u201cI
      don\\u2019t know\\u201d. While there are clear and broad benefits of uncertainty
      estimation in machine learning, we believe it is also important to recognize
      potential societal challenges that may arise. With increased performance and
      uncertainty estimation capabilities, humans will inevitably become increasingly
      trusting in a model\\u2019s predictions, as well as its ability to catch dangerous
      or uncertain decisions before they are executed. Thus, it is important to continue
      to pursue redundancy in such learning systems to increase the likelihood that
      mistakes can be caught and corrected independently.\",\n    \"output\": \"mentions
      a harmful application\"\n  },\n  {\n    \"input\": \"Paper Title: The Value
      Equivalence Principle for Model-Based Reinforcement Learning; Impact statement:
      The bulk of the research presented in this paper consists of foundational theoretical
      results about the learning of models for model-based reinforcement learning
      agents. While applications of these agents can have social impacts depending
      upon their use, our results merely serve to illuminate desirable properties
      of models and facilitate the subsequent training of agents using them. In short,
      this work is largely theoretical and does not present any foreseeable societal
      impact, except in the general concerns over progress in artificial intelligence.\",\n
      \   \"output\": \"doesn't mention a harmful application\"\n  },\n  {\n    \"input\":
      \"Paper Title: Graph Policy Network for Transferable Active Learning on Graphs;
      Impact statement: Graph-structured data are ubiquitous in real world, covering
      a variety of domains and applications such as social science, biology, medicine,
      and political science. In many domains such as biology and medicine, annotating
      a large number of labeled data could be extremely expensive and time consuming.
      Therefore, the algorithm proposed in this paper could help significantly reduce
      the labeling efforts in these domains \\u2014 we can train systems on domains
      where labeled data are available, then transfer to those lower-resource domains.
      We believe such systems can help accelerating some research and develop processes
      that usually take a long time, in domains such as drug development. It can potentially
      also lower the cost for such research by reducing the need of expert-annotations.
      However, we also acknowledge potential social and ethical issues related to
      our work. 1. Our proposed system can effectively reduce the need of human annotations.
      However, in a broader point of view, this can potentially lead to a reduction
      of employment opportunities which may cause layoff to data annotators. 2. GNNs
      are widely used in domains related to critical needs such as healthcare and
      drug development. The community needs to be extra cautious and rigorous since
      any mistake may cause harm to patients. 3. Training the policy network for active
      learning on multiple graphs is relatively time - and computational resource
      - consuming. This line of research may produce more carbon footprint compared
      to some other work. Therefore, how to accelerate the training process by developing
      more efficient algorithms requires further investigation. Nonetheless, we believe
      that the directions of active learning and transfer learning provide a hopeful
      path towards our ultimate goal of data efficiency and interpretable machine
      learning.\",\n    \"output\": \"mentions a harmful application\"\n  },\n  {\n
      \   \"input\": \"Paper Title: User-Dependent Neural Sequence Models for Continuous-Time
      Event Data; Impact statement: While many of the successful and highly-visible
      applications of machine learning are in classification and regression, there
      are a broad range of applications that don\\u2019t naturally fit into these
      categories and that can potentially benefit significantly from machine learning
      approaches. In particular, in this paper we focus on continuous-time event data,
      which is very common in real-world applications but has not yet seen significant
      attention from the ML research community. There are multiple important problems
      in society where such data is common and that could benefit from the development
      of better predictive and simulation, including: \\u2022 Education: Understanding
      of individual learning habits of students, especially in online educa- tional
      programs, could improve and allow for more personalized curricula. \\u2022 Medicine:
      Customized tracking and predictions of medical events could save lives and improve
      patients\\u2019 quality of living. \\u2022 Behavioral Models: Person-specific
      simulations of their behavior can lead to better systematic understandings of
      people\\u2019s social activities and actions in day-to-day lives. \\u2022 Cybersecurity:
      Through the user identification capabilities, our work could aid in cyber-security
      applications for the purposes of identifying fraud detection and identify theft.
      Another potential positive broad impact of the work, is that by utilizing amortized
      VI, our methods do not require further costly training or fine-tuning to accommodate
      new users, which can potentially produce energy savings and lessen environmental
      impact in a production setting. On the other hand, as with many machine learning
      technologies, there is also always the potential for negative impact from a
      societal perspective. For example, more accurate individualized models for user-generated
      data could be used in a negative fashion for applications such as surveillance
      (e.g., to monitor and negatively impact individuals in protected groups). In
      addition, better predictions and recommendations for products and services,
      through explicitly conditioning on prior behavior from a user, could potentially
      further worsen existing privacy concerns.\",\n    \"output\": \"mentions a harmful
      application\"\n  },\n  {\n    \"input\": \"Paper Title: Self-paced Contrastive
      Learning with Hybrid Memory for Domain Adaptive Object Re-ID; Impact statement:
      Our method can help to identify and track different types of objects ( e . g
      ., vehicles, cyclists, pedestrians, etc . ) across different cameras (domains),
      thus boosting the development of smart retail, smart transportation, and smart
      security systems in the future metropolises. In addition, our proposed self-paced
      contrastive learning is quite general and not limited to the specific research
      field of object re-ID. It can be well extended to broader research areas, including
      unsupervised and semi-supervised representation learning. However, object re-ID
      systems, when applied to identify pedestrians and vehicles in surveillance systems,
      might give rise to the infringement of people\\u2019s privacy, since such re-ID
      systems often rely on non-consensual surveillance data for training, i . e .,
      it is unlikely that all human subjects even knew they were being recorded. Therefore,
      governments and officials need to carefully establish strict regulations and
      laws to control the usage of re-ID technologies. Otherwise, re-ID technologies
      can potentially equip malicious actors with the ability to surveil pedestrians
      or vehicles through multiple CCTV cameras without their consent. The research
      committee should also avoid using the datasets with ethics issues, e . g .,
      DukeMTMC [37], which has been taken down due to the violation of data collection
      terms, should no longer be used. We would not evaluate our method on DukeMTMC
      related benchmarks as well. Furthermore, we should be cautious of the misidentification
      of the re-ID systems to avoid possible disturbance. Also, note that the demographic
      makeup of the datasets used is not representative of the broader population.\",\n
      \   \"output\": \"mentions a harmful application\"\n  },\n  {\n    \"input\":
      \"Paper Title: Real World Games Look Like Spinning Tops; Impact statement: This
      work focuses on better understanding of mathematical properties of real world
      games and how they could be used to understand successful AI techniques that
      were developed in the past. Since we focus on retrospective analysis of a mathematical
      phenomenon, on exposing an existing structure, and deepening our understanding
      of the world, we do not see any direct risks it entails. Introduced notions
      and insights could be used to build better, more engaging AI agents for people
      to play with in real world games (e.g. AIs that grow with the player, matching
      their strengths and weaknesses). In a broader spectrum, some of the insights
      could be used for designing and implementing new games, that humans would fine
      enjoyable though challenges they pose. In particular it could be a viewed as
      a model for measuring how much notion of progress the game consists of. However,
      we acknowledge that methods enabling improved analysis of games may be used
      for designing products with potentially negative consequences (e.g., games that
      are highly addictive) rather than positive (e.g., games that are enjoyable and
      mentally developing).\",\n    \"output\": \"mentions a harmful application\"\n
      \ },\n  {\n    \"input\": \"Paper Title: Adapting Neural Architectures Between
      Domains; Impact statement: This paper provides a novel perspective of cross-domain
      generalization in neural architecture search towards the efficient design of
      neural architectures with strong generalizability. This will lead to a better
      understanding of the generalizability of neural architectures. The proposed
      method will be used to design neural architectures for computer vision tasks
      with affordable computation cost.\",\n    \"output\": \"doesn't mention a harmful
      application\"\n  },\n  {\n    \"input\": \"Paper Title: Modeling Noisy Annotations
      for Crowd Counting; Impact statement: In this paper, we introduce a novel loss
      function for counting crowd numbers by explicitly considering annotation noise.
      It can be applied to any density map based network architecture and improve
      the counting accuracy generally. The research is also helpful for monitoring
      the crowd number in public and prevent the accidents caused by overcrowding.
      It could also be used in retail businesses to estimate the occupancy of a store
      or area, which helps with personal and resource management. Our method could
      also be applied to other objects, such as cell counting, plant/animal counting,
      etc, and other research areas that use point-wise annotations, e.g., eye gaze
      estimation. Since the research is based on images captured by cameras, users
      may be concerned about the privacy problem. However, our method does not directly
      detect or track individuals, and thus this concern may be eased.\",\n    \"output\":
      \"doesn't mention a harmful application\"\n  },\n  {\n    \"input\": \"Paper
      Title: Byzantine Resilient Distributed Multi-Task Learning; Impact statement:
      The problem of Byzantine resilient aggregation of distributed machine learning
      models has been actively studied in recent years; however, the issue of Byzantine
      resilient distributed learning in multi-task networks has received much less
      attention. It is a general intuition that MTL is robust and resilient to cyber-attacks
      since it can identify attackers by measuring similarities between neighbors.
      In this paper, we have shown that some commonly used similarity measures are
      not resilient against certain attacks. With an increase in data heterogeneity,
