      application/json\r\n\r\n[\n  {\n    \"input\": \"Paper Title: Continuous Meta-Learning
      without Tasks; Impact statement: Our work provides a method to extend meta-learning
      algorithms beyond the task-segmented case, to the time series series domain.
      Equivalently, our work extends core methods in changepoint detection, enabling
      the use of highly expressive predictive models via empirical Bayes. This work
      has the potential to extend the domain of applicability of both of these methods.
      Standard meta-learning relies on a collection of datasets, each corresponding
      to discrete tasks. A natural question is how such datasets are constructed;
      in many cases, these datasets rely on segmentation of time series data by experts.
      Thus, our work has the potential to make meta-learning algorithms applicable
      to problems that, previously, would have been too expensive or impossible to
      segment. Moreover, our work has the potential to improve the applicability of
      changepoint detection methods to difficult time series forecasting problems.
      While MOCA has the potential to expand the domain of problems addressable via
      meta-learning, this has the effect of amplifying the risks associated with these
      methods. Meta-learning enables efficient learning for individual members of
      a population via leveraging empirical priors. There are clear risks in few-shot
      learning generally: for example, efficient facial recognition from a handful
      of images has clear negative implications for privacy. Moreover, while there
      is promising initial work on fairness for meta-learning [39], we believe considerable
      future research is required to understand the degree to which meta-learning
      algorithms increase undesirable bias or decrease fairness. While it is plausible
      that fine-tuning to the individual results in reduced bias, there are potential
      unforeseen risks associated with the adaptation process, and future research
      should address how bias is potentially introduced in this process. Relative
      to decision making rules that are fixed across a population, algorithms which
      fine-tune decision making to the individual present unique challenges in analyzing
      fairness. Further research is required to ensure that the adaptive learning
      enabled by algorithms such as MOCA do not lead to unfair outcomes.\",\n    \"output\":
      \"mentions a harmful application\"\n  },\n  {\n    \"input\": \"Paper Title:
      Learning Rich Rankings; Impact statement: Flexible ranking distributions that
      can be learned with provable guarantees can facilitate more powerful and reliable
      ranking algorithms inside recommender systems, search engines, and other ranking-based
      technological products. As a potential adverse consequence, more powerful and
      reliable learning algorithms can lead to an increased inappropriate reliance
      on technological solutions to complex problems, where practitioners may be not
      fully grasp the limitations of our work, e.g. independence assumptions, or that
      our risk bounds, as established here, do not hold for all data generating processes.\",\n
      \   \"output\": \"mentions a harmful application\"\n  },\n  {\n    \"input\":
      \"Paper Title: Reinforcement Learning for Control with Multiple Frequencies;
      Impact statement: In recent years, reinforcement learning (RL) has shown remarkable
      successes in various areas, where most of their results are based on the assumption
      that all decision variables are simultaneously determined at every discrete
      time step. However, many real-world sequential decision-making problems involve
      multiple decision variables whose control frequencies are different by the domain
      requirement. In this situation, standard RL algorithms without considering the
      control frequency requirement may suffer from severe performance degradation
      as discussed in Section 3. This paper provides a theoretical and algorithmic
      foundation of how to address multiple control frequencies in RL, which enables
      RL to be applied to more complex and diverse real-world problems that involve
      decision variables with different frequencies. Therefore, this work would be
      beneficial for those who want to apply RL to various tasks that inherently have
      multiple control frequencies. As we provide a general-purpose methodology, we
      believe this work has little to do with a particular system failure or a particular
      data bias. On the other hand, this work could contribute to accelerating industrial
      adoption of RL, which has the potential to adversely affect employment due to
      automation.\",\n    \"output\": \"mentions a harmful application\"\n  },\n  {\n
      \   \"input\": \"Paper Title: Latent Dynamic Factor Analysis of High-Dimensional
      Neural Recordings; Impact statement: While progress in understanding the brain
      is improving life through research, especially in mental health and addiction,
      in no case is any brain disorder well understood mechanistically. Faced with
      the reality that each promising discovery inevitably reveals new subtleties,
      one reasonable goal is to be able to change behavior in desirable ways by modifying
      specific brain circuits and, in animals, technologies exist for circuit disruptions
      that are precise in both space and time. However, to determine the best location
      and time for such disruptions to occur, with minimal off-target effects, will
      require far greater knowledge of circuits than currently exists: we need good
      characterizations of interactions among brain regions, including their timing
      relative to behavior. The over-arching aim of our research is to provide methods
      for describing the flow of information, based on evolving neural activity, among
      multiple regions of the brain during behavioral tasks. Such methods can lead
      to major advances in experimental design and, ultimately, to far better treatments
      than currently exist.\",\n    \"output\": \"doesn't mention a harmful application\"\n
      \ },\n  {\n    \"input\": \"Paper Title: Reducing Adversarially Robust Learning
      to Non-Robust PAC Learning; Impact statement: Learning predictors that are robust
      to adversarial perturbations is an important challenge in contem- porary machine
      learning. Current machine learning systems have been shown to be brittle against
      different notions of robustness such as adversarial perturbations [Szegedy et
      al., 2013, Biggio et al., 2013, Goodfellow et al., 2014], and there is an ongoing
      effort to devise methods for learning predictors that are adversarially robust.
      As machine learning systems become increasingly integrated into our everyday
      lives, it becomes crucial to provide guarantees about their performance, even
      when they are used outside their intended conditions. We already have many tools
      developed for standard learning, and having a universal wrapper that can take
      any standard learning method and turn it into a robust learning method could
      greatly simplify the development and deployment of learning that is robust to
      test-time adversarial perturbations. The results that we present in this paper
      are still mostly theoretical, and limited to the realizable setting, but we
      expect and hope they will lead to further theoretical study as well as practical
      methodological development with direct impact on applications. In this work
      we do not deal with training-time adversarial attacks, which is a major, though
      very different, concern in many cases. As with any technology, having a more
      robust technology can have positive and negative societal consequences, and
      this depends mainly on how such technology is utilized. Our intent from this
      research is to help with the design of robust machine learning systems for application
      domains such as healthcare and transportation where its critical to ensure performance
      guarantees even outside intended conditions. In situations where there is a
      tradeoff between robustness and accuracy, this work might be harmful in that
      it would prioritize robustness over accuracy and this may not be ideal in some
      application domains.\",\n    \"output\": \"mentions a harmful application\"\n
      \ },\n  {\n    \"input\": \"Paper Title: Online Non-Convex Optimization with
      Imperfect Feedback; Impact statement: This is a theoretical work which does
      not present any foreseeable societal consequence.\",\n    \"output\": \"doesn't
      mention a harmful application\"\n  },\n  {\n    \"input\": \"Paper Title: Digraph
