      \ },\n  {\n    \"input\": \"Paper Title: Sub-sampling for Efficient Non-Parametric
      Bandit Exploration; Impact statement: This work is advertising a new way to
      do non-parametric exploration in bandit models, that enjoy good empirical performance
      and strong theoretical guarantees. First, bandit problems are at the heart of
